import React, { useState, useEffect } from 'react';
import "./Bots.css";

function Bots() {
    
    const bots = [
        {id: 1, brand: 'Ford'},
        {id: 2, brand: 'BMW'},
        {id: 3, brand: 'Audi'}
      ];
   
    return (
        <div>
            <div className="bot-container">
                <div className="msg-container"> 
                    <input 
                    type = "text" 
                    className='bots'
                    placeholder="Available Bots"
                    value={botName} 
                    />
                </div>
            </div>
        </div>
    )
}

export default Bots
